import React from 'react';
import './navbar.css';
import logo from '../../assets/img/navbar_logo.png'
import {NavLink} from "react-router-dom";
import {useDispatch, useSelector} from "react-redux";
import {logout} from "../../reducers/userReducer";
import {start} from "../../actions/range";
import "./navbar.css";
const Navbar = () => {
    const isAuth = useSelector(state=>state.user.isAuth)
    const dispatch = useDispatch()


    return (
        <div className={"navbar"}>
            <img className={"navbar_logo"} src={logo} alt=""/>
            <div className={"navbar_header"}>Header</div>
            {!isAuth &&
            <div className="navbar_login">
                <NavLink to={"/login"}>Login</NavLink>
                <NavLink to={"/registration"}>Registration</NavLink>
            </div> }
            {isAuth &&
            <div>
                <NavLink to={"/game"}>Play in quiz</NavLink>
                <NavLink to={"/history"}>History</NavLink>
                <NavLink to={"/range"}>
                    <button onClick={()=> setTimeout(() =>
                            start('history')
                        , 1000)}>
                        Top 10 of results
                    </button></NavLink>
                <NavLink to={"/settings"}>Settings</NavLink>
                <button className="navbar_login" onClick={()=>dispatch(logout())}>Log out</button>
            </div>
            }
        </div>
    );
};

export default Navbar;
